import React, { useState ,useEffect } from 'react';

import 'tailwindcss/tailwind.css';
import Homepage from './HomePage';
import axios from 'axios';
import { useParams } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
import { useAuth0 } from '@auth0/auth0-react';


const ClassroomInterface = () => {

const [classroom , setClassrooms ] = useState([null])
const {user } = useAuth0();
const { code } = useParams(); // Get the classroom code from the URL
const navigate = useNavigate();

const fetchclassroomDetails = async ()=>{

  try{
    const response = await axios.get(`http://localhost:8000/classrooms/bycode/${code}`)
    console.log(response)
    setClassrooms(response.data.classroom)
  }
  catch(error){
console.error('Error fetching classroom details:', error);  }

}


useEffect(() => {
  fetchclassroomDetails();
}, [code]); // Fetch data when the component mounts


  return (
    <>
    { classroom ? 
    
    <body>
       <Homepage showPlusIcon={false} />
        <div className="container mx-auto px-4">
          <div className="bg-blue-500 text-white p-4 rounded-lg shadow-md">
            <h1 className="text-3xl font-bold">{classroom.title}</h1>
            <p className="text-xl">{classroom.description}</p>
          </div>
          <div className="grid grid-cols-3 gap-4 mt-4">
            { ! user.eamil === classroom.teacher ? 
            <div className="col-span-1 bg-zinc-100 p-4 rounded-lg shadow-md">
              <h2 className="font-semibold text-lg mb-2">Upcoming</h2>
              <p>Woohoo, no work due soon!</p>
              <button className="mt-4 bg-blue-600 text-white rounded py-2 px-4" >View all</button>
            </div>:
            
            <div className="col-span-1 bg-zinc-100 p-4 rounded-lg shadow-md">
              <p>Asisigned quizzes here</p>
              <button className="mt-4 bg-blue-600 text-white rounded py-2 px-4" onClick={()=>{
                window.location.href
              }}>Assign Here</button>
            </div>
            
          
            }
            
            <div className="col-span-2">
            {
                  user.email=== classroom.teacher ? 
              <div className="bg-white p-4 rounded-lg shadow-sm mb-4">
                <div className="flex items-center justify-between">
                
                  <button className="mt-4 bg-blue-600 text-white rounded py-2 px-4" onClick={()=>{
                    navigate(`/generate/${classroom.code}`)
                  }}>Create Quiz</button> 

                </div>
              </div>:

              <></>
  
            }
  
              <div className="bg-white p-4 rounded-lg shadow-sm">
                <div className="flex items-center justify-between">
                  <h3 className="font-semibold text-lg">Mrinmoyee Mukherjee</h3>
                </div>
                <p>Dear Students,</p>
                <p>
                  All students are requested to upload the following in the respective batch folders
                  the following SNL documents-
                </p>
                <ol className="list-decimal ml-4">
                  <li>Soft copy of report</li>
                  <li>Soft copy of final presentation</li>
                  <li>Video of working model/ Few output pictures</li>
                </ol>
                <p>Groups have to create individual project folders and then upload the documents</p>
                <a
                  href="https://drive.google.com/drive/folders/1CAYexRuQjMqjpOFebnI4jBxZ0jYFHzCp?usp=sharing"
                  className="text-blue-600">
                  Document Link
                </a>
              </div>
            </div>
          </div>
        </div>
      </body>:<></>
    }
    </>
  );
}

export default ClassroomInterface;
